import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './home';
import Rental from './rent';

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/rental" exact component={Rental} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
